import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Users from './components/Users';
import Problems from './components/Problems';
import Contests from './components/Contests';
import Register from './components/Register';
import Login from './components/Login';
import ProblemDetails from './components/ProblemDetails';
import VerifyPage from './components/VerifyPage';
import './App.css'; // Make sure the CSS file is imported
import Slider from './components/Slider'; // Custom slider component
import DeveloperCard from './components/DeveloperCard'; // Custom card for developer info

const App = () => {
  return (
    <Router>
      <div>
        {/* Header */}
        <header>
          <h1>CodeMax</h1>
          <nav>
            <div className="left-links">
              <Link to="/">Home</Link> |  
              <Link to="/problems">Problems</Link> |  
              <Link to="/contests">Contests</Link>
            </div>
            <div className="right-links">
              <Link to="/register">Register</Link> |  
              <Link to="/login">Login</Link>
            </div>
          </nav>
        </header>

        {/* Slider Section */}
        <Slider />

        {/* Main Routes */}
        <main>
          <Routes>
            {/* Home page */}
            <Route
              path="/"
              element={<h2>Welcome to CodeMax! Choose an option from the navigation above.</h2>}
            />

            {/* Existing components */}
            <Route path="/users" element={<Users />} />
            <Route path="/problems" element={<Problems />} />
            <Route path="/contests" element={<Contests />} />

            {/* Login and Registration components */}
            <Route path="/register" element={<Register />} />
            <Route path="/login" element={<Login />} />
            <Route path="/verify" element={<VerifyPage />} />

            {/* ProblemDetails route for viewing problem details */}
            <Route path="/problems/:id" element={<ProblemDetails />} />
          </Routes>
        </main>

        {/* About Us Section */}
        <section className="about-us">
          <h2>About Us</h2>
          <p>
            CodeMax is your ultimate platform to hone your programming skills, 
            participate in exciting coding contests, and explore a world of challenging problems. 
            Our mission is to empower developers by providing them with the best learning experience and resources.
          </p>
          <div className="cards-container">
            <DeveloperCard
              name="Haider"
              description="Hi! I’m Haider, a passionate Python developer and AI student at ITU Lahore. 
              I specialize in data visualization, machine learning, and building dynamic web applications."
              skills={['Python', 'Django', 'React', 'Streamlit', 'Machine Learning']}
              image="https://via.placeholder.com/150" // Replace with your photo URL if available
            />
          </div>
        </section>
      </div>
    </Router>
  );
};

export default App;
